import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
} from "react-router-dom";
 
import Navbar from "./Components/Navbar";
 
function Alltimelog() {
    return (
        <>
            <Navbar />
            <Router>
                <Switch>
                    <Route
                        exact
                        path="/"
                    />
 
                    <Route
                        exact
                        path="/courses"
                    />
                </Switch>
            </Router>
        </>
    );
}
 
export default Alltimelog;
